// Toggle the lines between dash and solid
function toggleLine(tp, mode)
{
	if(tp[0]==0)
	{
		changeDotted("1");
		changeDotted("3");
	}
	if(tp[1]==0)
	{
		changeDotted("2");
		changeDotted("15");
	}
	if(tp[0]==1)
	{
		if(tp[2]==1)
			changeSolid("1");
		else
			changeDotted("1");
		if(tp[3]==1)
			changeSolid("3");
		else
			changeDotted("3");
	}
	if(tp[1]==1)
	{
		if(tp[2]==1)
			changeSolid("15");
		else
			changeDotted("15");
		if(tp[3]==1)
			changeSolid("2");
		else
			changeDotted("2");
	}

	if(tp[2]==0)
		resetMode(3);
	if(tp[3]==0)
		resetMode(4);

	if(tp[2]==1)
		changeMode(3,modeArray);
	if(tp[3]==1)
		changeMode(4,modeArray);
}

function changeSolid(num)
{
	document.getElementById("Line-"+num).setAttribute('src',"./solid/images/Line_"+num+".png");
	document.getElementById("Line-"+num).style.opacity = ".9";
}

function changeDotted(num)
{
	document.getElementById("Line-"+num).setAttribute('src',"./dotted/images/Line_"+num+".png");
	document.getElementById("Line-"+num).style.opacity = ".3";
}

function resetMode(node)
{
	if(node == 3)
	{
		changeDotted(12);
		changeDotted(5);
		changeDotted(10);
		changeDotted(7);
		changeDotted(14)
	}
	if(node == 4)
	{
		changeDotted(13);
		changeDotted(8);
		changeDotted(9);
		changeDotted(6);
		changeDotted(11);
	}
}

function changeMode(node,modeArray)
{
	if(node == 3)
	{
		if(modeArray[0]==1)
			changeSolid(12);
		else
			changeDotted(12);
		if(modeArray[1]==1)
			changeSolid(5);
		else
			changeDotted(5);
		if(modeArray[2]==1)
			changeSolid(10);
		else
			changeDotted(10);
		if(modeArray[3]==1)
			changeSolid(7);
		else
			changeDotted(7);
		if(modeArray[4]==1)
			changeSolid(14);
		else
			changeDotted(14);
	}
	
	if(node == 4)
	{
		if(modeArray[0]==1)
			changeSolid(13);
		else
			changeDotted(13);
		if(modeArray[1]==1)
			changeSolid(8);
		else
			changeDotted(8);
		if(modeArray[2]==1)
			changeSolid(9);
		else
			changeDotted(9);
		if(modeArray[3]==1)
			changeSolid(6);
		else
			changeDotted(6);
		if(modeArray[4]==1)
			changeSolid(11);
		else
			changeDotted(11);
	}
}

function getTrainingData(){
	if (tpArray[0] == 1){
		return "kaggle";
	}
	else if (tpArray[1] == 1){
		return "kepler";
	}
	return "";
}

function getProcessingData(){
	if (tpArray[2] == 1){
		return "tsfresh";
	}
	else if (tpArray[3] == 1){
		return "lightkurve";
	}
	return "";
}

function getModeData(){
	modeString = "";
	
	for (let i = 0; i < modeArray.length; i++){
		if (modeArray[i] == 1){
			if (i == 0)
				modeString += "rnn";
			else if (i == 1)
				modeString += "lstm";
			else if (i == 2)
				modeString += "gru";
			else if (i == 3)
				modeString += "lr";
			else if (i == 4)
				modeString += "rf";
			modeString += ",";
		}	
	}
	modeString = modeString.slice(0,-1);
	return modeString;
}

// Sends the https request to the server
function httpRequest(){
	inputData = document.getElementById("Input-Box-1").value;
	
	if(!dropDown.includes(inputData)){
		inputErrorMessage();
	}
	else{		
		trainingData = getTrainingData();	
		processingData = getProcessingData();
		modeData = getModeData();	
		
		const Http = new XMLHttpRequest();
		const url = 'http://35.225.133.86:8001/?input='+inputData+'&training_data='+trainingData+'&processing='+processingData+'&models=['+modeData+']';
		
		Http.open("GET", url);
		Http.send();
		
		Http.onreadystatechange=function(){
			if(this.readyState==4 && this.status == 200){
				testResponse = JSON.parse(Http.responseText)
				
				checker=1;
				
				pixelFileImage = testResponse.targetpixelfile.substring(2, testResponse.targetpixelfile.length-3)
				document.getElementById('Target-Pixel-Files-5').src = "data:image/png;base64," + pixelFileImage;
				
				filterDisplay();
				
			}
			else{
				console.log("fail to connect")		
			}
		}
	}
}

